using namespace std;

class Solution {
public:
	bool isMatch(const char *s, const char *p) {
		const char *last_s = NULL;
		const char *last_p = NULL;
		while ('\0' != *s || '*' == *p)
		{
			if (*s == *p || '?' == *p)
			{
				s++;
				p++;
				continue;
			}
			if ('*' == *p)
			{
				while ('*' == *p)
				{
					last_p = p;
					p++;
				}
				while ('\0' != *s && (*s != *p && '?' != *p))
				{
					s++;
				}
				last_s = s;
				continue;
			}
			if (last_p != NULL)
			{
				p = last_p;
				s = last_s+1;
				continue;
			}
			return false;
		}
		if ('\0' == *p)
		{
			return true;
		}
		return false;
	}

	bool isMatch_PD(const char *s, const char *p) {
		int len_s = strlen(s);
		int len_p = strlen(p);
		if (0==len_p*len_s)
		{
			if ('\0' == *s && '\0' == *p)
			{
				return true;
			}
			if ('*' == *s)
			{
				s++;
				return isMatch(s, p);
			}
			if ('*' == *p)
			{
				p++;
				return isMatch(s, p);
			}
			return false;
		}
		bool* last = (bool *)malloc(sizeof(bool) * len_p);
		bool* current = (bool *)malloc(sizeof(bool) * len_p);
		memset(last, false, sizeof(bool) * len_p);
		memset(current, false, sizeof(bool) * len_p);
		if ('*' == *s)
		{
			memset(last, true, sizeof(bool) * len_p);
		}
		else if (*s == *p || '?' == *s || '?' == *p || '*' == *p)
		{
			last[0] = true;
		}

		for (int i = 1; i < len_s; ++i)
		{
			memset(current, false, sizeof(bool) * len_p);
			if ('*' == *p || (last[0] && '*'==s[i]))
			{
				current[0] = true;
			}
			for (int j = 1; j < len_p; ++j)
			{
				if (((last[j]||current[j-1]) && ('*'==p[j]||'*'==s[i])) || (last[j-1] && ('?'==s[i]||'?'==p[j]||s[i]==p[j])))
				{
					current[j] = true;
				}
			}
			bool* tmp = last;
			last = current;
			current = tmp;
		}
		return last[len_p-1];
	}

	bool isMatch_recursion(const char *s, const char *p) {
		if ('\0' == *s && '\0' == *p)
		{
			return true;
		}
		if ('*' == *s)
		{
			return asteriskMatch(s, p);
		}
		if ('*' == *p)
		{
			return asteriskMatch(p, s);
		}
		if (*s == *p || '?' == *s || '?' == *p)
		{
			s++;
			p++;
			return isMatch(s, p);
		}
		else
		{
			return false;
		}
	}
private:
	bool asteriskMatch(const char *asterisk, const char *p)
	{
		asterisk++;
		if ('*' == *asterisk)
		{
			return asteriskMatch(asterisk, p);
		}
		while (*p != '\0')
		{
			if (isMatch(asterisk, p))
			{
				return true;
			}
			p++;
		}
		if ('\0' == *asterisk && '\0' == *p)
		{
			return true;
		}
		return false;
	}
};
